import { Card, TextField, CardContent, Grid, makeStyles } from '@material-ui/core';
import { DatePicker } from '@material-ui/pickers';
import React, { useState } from 'react';
import SignUp from '../components/signup';

// const useStyles = makeStyles(theme => ({
// 	pageContent : {
// 		margin : theme.spacing(5),
// 		padding : theme.spacing(3)
// 	}
// }));

export const Register = () => {
	// const classes = useStyles();
	const [date, changeDate] = useState(new Date());
	return (
		<Card>
			<CardContent>
				<Grid container>
					<Grid item xs={12} sm={6}>
						<TextField 
							id="outlined-basic" 
							label="first name" 
							variant="outlined"
							// style={{ width : '80%' }}
							fullWidth
							margin = 'normal'
						/>
					</Grid>
					<Grid item xs={12} sm={6}>
						<TextField 
							id="outlined-basic" 
							label="Last name" 
							variant="outlined"
							// style={{ width : '80%' }}
							fullWidth
							margin = 'normal'
						/>
					</Grid>
					<Grid item xs={12}>
						<TextField 
							id="outlined-basic" 
							label="Email" 
							variant="outlined"
							fullWidth
							margin = 'normal'
						/>
					</Grid>
					<Grid item xs={12} sm={6}>
						<TextField 
							id="outlined-basic" 
							label="Profession" 
							variant="outlined"
							fullWidth
							margin = 'normal'
						/>
					</Grid>
					<Grid item xs={12} sm={6}>
						<TextField 
							id="outlined-basic" 
							label="Phone" 
							variant="outlined"
							fullWidth
							margin = 'normal'
						/>
					</Grid>
					<Grid item xs={12} sm={6}>
						<DatePicker
							autoOk
							variant="static"
							openTo="year"
							value={date}
							onChange={changeDate}	
						/>
					</Grid>

				</Grid>
			</CardContent>
		</Card>
	);
};
